import React from "react";
import { Switch, Route } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom";
import Cart from "./Cart";

const CartPage = () => {

    return(
        <Router>
        <Switch>
            <Route exact path="/cart" component={Cart} />
        </Switch>
        </Router>
    )
}

export default CartPage;
